INSERT INTO `r_jobs` (`id`, `name`, `skills`, `description`, `who_apply`, `offer`, `salary`, `experience`, `closing_date`, `email`, `inactive`, `created_at`, `updated_at`) VALUES
(5, 'Software Engineer (PHP)', '<ul>\r\n	<li>1 to 3 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	Programmer/ Software Engineer</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Software Company</li>\r\n	<li>Freshers are also encouraged to apply.</li>\r\n</ul>', '<ul>\r\n	<li>Strong knowledge on web development using php, html, javascript, database</li>\r\n	<li>Expertise on large scale web application.</li>\r\n	<li>Strong knowledge on MVC framework.</li>\r\n	<li>Good knowledge on Templating language.</li>\r\n	<li>Expertise on API development</li>\r\n	<li>Need to work individually or with a team.</li>\r\n	<li>Basic or Intermediate knowledge on android app development</li>\r\n</ul>', '<ul>\r\n	<li>Age 20 to 35 years</li>\r\n	<li>Only males are allowed to apply</li>\r\n	<li>Highly skilled in php, mysql, javascript, html</li>\r\n	<li>Must be honest, Sincere, Professional.</li>\r\n	<li>We are Savar, Dhaka based company.</li>\r\n	<li>Qualified candidates near Savar, Dhaka Will get high preference</li>\r\n</ul>', '<ul>\r\n	<li>Festival Bonus: 2(Yearly)</li>\r\n	<li>Spot Bonus</li>\r\n	<li>Yearly Bonus</li>\r\n	<li>Evening Snacks</li>\r\n	<li>Flexible office time</li>\r\n	<li>Overtime payment</li>\r\n</ul>', 20000, 1, '2019-01-25', 'sales@roopokar.com', 0, '2018-12-26 09:42:24', '2018-12-26 09:58:47');
