INSERT INTO `tbl_notice` (`notice_id`, `notice_title`, `notice_desc`, `notice_department`, `notice_employee`, `notice_added_by`, `notice_publish_from`, `notice_publish_to`, `notice_status`, `notice_created_at`, `notice_updated_at`) VALUES
(1, 'Message from Deputy Managing Director', 'Azfar Hossain, is a second generation enterpreneur. He competed his Bachelors and Masters Degree in Economics from the University of Waterloo, Canada. Following that he pursued an MBA from Queen\'s University, Canada. After the completion of his education, he returned to Bangladesh to help futher develop the family businesses.\r\n\r\n \r\n\r\nLinkedIn: http://bd.linkedin.com/in/azfarh/\r\n\r\nAzfar Hossain\r\n\r\nDeputy Managing Director -  Nawab Abdul Malek Jute Mills Ltd.\r\n\r\nDirector                                     Associated Engineers & Drillers Ltd.', '813', 'null', 116, '2019-01-01', '2019-12-31', 1, '2019-04-08 12:35:09', '2019-04-08 12:35:46'),
(2, 'Message from Managing Director', 'Ahmed Hossain is a well known personality in the Bangladesh Jute Industry. He has served the Bangladesh Jute Spinners Association (BJSA) as the chairman for five terms.\r\n\r\n \r\n\r\nHe has played a key role in developing NAM as one of the leading jute manufacturers in the country. Under his leadership the company has witnessed a 1900% growth in production. NAM is the only surviving mill amongst those that were denationalized in the 1970s.\r\n\r\nAhmed Hossain\r\n\r\n\r\n\r\nManaging Director - Nawab Abdul Malek Jute Mills Ltd.\r\n\r\n                                     Hossain Jute Trading Co.\r\n\r\nChairman - Associated Engineers & Drillers Ltd.\r\n\r\nFormer Chairman - Bangladesh Jute Spinners Association', '813', 'null', 116, '2019-01-01', '2019-12-31', 1, '2019-04-08 12:36:33', NULL),
(3, 'Message from the Chairman', 'Associated Engineers & Drillers Ltd. (AED) was founded in 1960 to tackle the water supply needs of Bangladesh. Over the years we have gained strength by expanding our range of business activities as well as by investing heavily in our core business. We have expanded into the supply of water-related products, jute yarn manufacturing as well as construction, and completed a broad spectrum of projects for a growing list of clients.\r\n\r\n\r\n\r\nNawab Abdul Malek Jute Mills Ltd. was privatized and commenced operations under the current management in April 1979. Over time it has become one of the best jute mills in the world. We are justly proud of the reputation we have earned for efficient, quality driven production, as well as our strong sense of business ethics. Over time, we have chosen to base our growth on technical expertise fueled by a reservoir of dynamic, efficient and experienced personnel.\r\n\r\n\r\n\r\nWe invite you to examine the levels of expertise and services that our employees are prepared to offer. Our commitment to our customers is that we will always offer high quality goods with integrity. \r\n\r\n\r\n\r\nSaad Z Hossain completed his undergraduate in Commerce and English Literature at the Mcintyre School of Commerce, University of Virginia. He is also a notable writer. His novels include Escape from Baghdad! and Djinn City, published in the US, India, France, and Bangladesh. \r\n\r\nSaad Zubair Hossain\r\n\r\nChairman - Nawab Abdul Malek Jute Mills Ltd. \r\n\r\nManaging Director - Associated Engineers & Drillers Ltd.', '813', 'null', 116, '2019-01-01', '2019-12-31', 1, '2019-04-08 12:37:31', NULL);
